/*
*   Name: App.js
*   Main app page
*   Routes to the login and connected pages listed in Routes
*   Date: 05/02/2020
*   Author: Lyka Marcelino
* */

import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Routes from './Routes';

function App() {
    return(
        <>
            <Routes/>
        </>
    );
}
export default App;
